import React from 'react'
import Link from 'next/link'

const NavLink = ({ href }) => {
    return (
        <Link href={href}>
            <a>About</a>
        </Link>    
    )
}

const NavBar = () => {
    return (
    <div className='bg-gray-500 py-4'>
        <NavLink href='/about'>About</NavLink>    
        <Link href='/register'>
            <a>Register</a>
        </Link> 
        <Link href='/login'>
            <a>Login</a>
        </Link> 
    </div>
    )
}

export default NavBar
